import React from 'react-dom'
import styled from 'styled-components'
import Text from './Text'

const BodyText = ({ children }) => (
  <Text fontSize='18px' style={{'textAlign': 'center'}}>{children}</Text>
)

const Bio = () => (
  <Container>
    <Content>
      <Text fontSize='18px'>
        I am a Computer Science Undergraduate at the University of Singapore.
      </Text>

      <Text fontSize='18px'>
        I have experience in full-stack web development and am seeking to take on new challenges
        to make an impact on people's lifestyles through technology.
      </Text>

      <Text fontSize='18px'>
        I'm into:
      </Text>

      <Text fontSize='18px'>
        Coffee • Jazz • Photography • Sailing
      </Text>
    </Content>
  </Container>
)

export default Bio

const Container = styled.section`
  width: 100%;
  height: 50vh;

  display: flex;
  align-items: center;
  justify-content: center;
`

const Content = styled.div`
  max-width: 30%;
  display: flex;
  flex-direction: column;
  align-items: center;
`
